import React, { Component } from 'react';
import PropTypes from 'prop-types';
import styles from './PageHeader.module.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class PageHeader extends Component{
  render() {

    return (

      <div className={styles.PageHeader}>
        <div>hello world</div>

        <Navbar bg="light" expand={false}>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="text-center" defaultActiveKey="/">
              {(() => {
                console.log(this.props.components);
                let components = [];
                console.log(this.props.components[0].name);
                for(i=0; i < this.props.components.length; i++) {

                    console.log("path: " + this.props.components[i].path);
                    console.log("name: " + this.props.components[i].name);
                    components.push(
                      <Nav.Link key="{component}" href={this.props.components[i].path}>
                        {this.props.components[i].name.replace(/([A-Z])/g, ' $1').trim()}
                      </Nav.Link>
                    )
                  }
                return components;
              })()}
              {/* <Nav.Link href="/">Start</Nav.Link>
              <Nav.Link href="/questions">Answer Questions</Nav.Link>
              <Nav.Link href="/date">Set Date</Nav.Link>
              <Nav.Link href="/completion">Review Form</Nav.Link> */}
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

export default PageHeader;
